const Property = ({ address, image, price }) => {
    return (
        <li>
            <div>
                <img src={image} alt="property" />
            </div>
            <div>
                <h3>{address}</h3>
                <h2>{price}</h2>
            </div>
        </li>
    )
}

export default Property;
